        this.stateDirection = 'left';

        this.monthNames = [
            'Styczeń',
            'Luty',
            'Marzec',
            'Kwiecień',
            'Maj',
            'Czerwiec',
            'Lipiec',
            'Sierpień',
            'Wrzesień',
            'Październik',
            'Listopad',
            'Grudzień'
        ];
        this.currentDate = new Date();
        this.currentMonth = this.currentDate.getMonth();
        this.currentYear = this.currentDate.getFullYear();

        this.leftCurrentDate = this.currentDate;
        this.rightCurrentDate = this.currentDate;

        this.seclectedLeftDate = null;
        this.seclectedRightDate = null;
        this.clicked = false;
        this.leftSelectedWindow = 'menu'
