    formatDate(date) {
        const day = date.getDate().toString().padStart(2, '0');
        const month = (date.getMonth() + 1).toString().padStart(2, '0');
        const year = date.getFullYear();
        const hour = date.getHours().toString().padStart(2, '0');
        const min = date.getMinutes().toString().padStart(2, '0');

        return `${day}.${month}.${year} | ${hour}:${min}`;
    }
    setRealInput(direction = 'l') {
        if (direction == 'l') {
            var leftDateInput = this.formatDate(this.seclectedLeftDate);
            $('#in-l-' + this.id).text(leftDateInput);
        } else {
            var rightDateInput = this.formatDate(this.seclectedRightDate);
            $('#in-r-' + this.id).text(rightDateInput);
        }
    }
