        var start = '<div id="' + d + '-' + direction + '" onclick="datepickerplugin.clicked = true; datepickerplugin.setYear(' + d + ',`' + direction + '`); this.className = `remove-color-' + direction + '-' + this.id + '`; this.style.backgroundColor = `#007548`; this.style.color = `white` " type="button" style="display:flex;flex-direction:column;justify-content: center; align-items: center; color:#2D2926"><div style="margin: 0 10px;margin-bottom:-2px; width:40px;text-align:center;">';
